//   const [ events,setEvents ] = useState([])

  
//   useEffect(() => {
//     const fetchEvents = async () => {
//     const response = await fetch ('/api/events/')
//     const json = await response.json()

//       if(response.ok){
//         console.log(json)
//         setEvents(json)

//       }
//     }
//     fetchEvents()
//   },[])

//   return(
//     <div>First event {events[0].email}</div>
//   )

// }



const locales = { 
  "en-US": require("date-fns/locale/en-US")
}

const localizer = dateFnsLocalizer({
  format,
  parse,
  startOfWeek,
  getDay,
  locales
})


// This is dummy events, we would implement our database to get actual events
const events = [
  {
    title: "Big Meeting",
    allDay: true,
    start: new Date(2023,10,0),
    end: new Date(2023,10,0),
    participants: [],
  },
  {
    title: "Vacation",
    start: new Date(2023,9,17),
    end: new Date(2023,9,20),
    participants: [],
    
  },
  {
    title: "Conference",
    start: new Date(2023,9,25),
    end: new Date(2023,9,25),
    participants: [],
  },

]
// Be able to put a button on each event that says "Join Event"
function CustomEvent({event}){
  // Add the current users email to the list of participants.
  const handleParticipants = () => {
    event.participants.push("The email");
  }

  return (
    <div className='custom-event'>
      <div>{event.title}</div>
      <div>Participants: {event.participants.length > 0 ? event.participants.join(", ") : "No participants yet"}</div>
      <button onClick={handleParticipants}>Join Event</button>
    </div>
  )
}




function App() {
  const [ events, setEvents ] = useState([])

  // Every time you make a new event, change these values.
  const [ newEvent, setNewEvent ] = useState({title: "", start: "", end: "", description: ""})

  // const [allEvents, setAllEvents] = useState(events)
     useEffect(() => {
      const fetchEvents = async () => {
      const response = await fetch ('/api/events/')
      const json = await response.json()
  
        if(response.ok){
          console.log(json)
          setEvents(json)
  
        }
      }
      fetchEvents()
    },[])
  

    function handleAddEvent() {
      fetch('/api/events/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(newEvent),
      })
        .then((response) => {
          if (response.ok) {
            // If the request is successful, you may want to update the events list by fetching it again.
            fetchEvents();
            // Clear the form or take any other appropriate action.
            setNewEvent({
              title: '',
              start: '',
              end: '',
              description: '',
            });
          } else {
            throw new Error('Failed to add the event to the database.');
          }
        })
        .catch((error) => {
          console.error(error);
        });
    }
    




  return (
    <div className='App'>
      <h1>
        Calendar
      </h1>
      <h2>Add New Event</h2>
      <div>
        <input type="text" placeholder='Add Title 255 characters' style={{ width: "20%", marginRight: "10px"}}
          value={newEvent.title} onChange={(e) => setNewEvent({...newEvent, title: e.target.value})} required maxLength={255}
        />
        <input type="text" placeholder='Add description 600 characters' style={{ width: "15%", height: "75px", marginRight: "10px", justifyContent:"center", alignItems:"flex-start"}}
          value={newEvent.description} onChange={(e) => setNewEvent({...newEvent, description: e.target.value})} required maxLength={600}
        />
        <DatePicker placeholderText="Start Date" style={{marginRight: "10px"}}
        selected={newEvent.start} onChange={(start) => setNewEvent({...newEvent,start})}/>
        <DatePicker placeholderText="End Date"
        selected={newEvent.end} onChange={(end) => setNewEvent({...newEvent,end})}/>
        <button style={{marginTop: "10px"}} onClick={handleAddEvent}>Add Event</button>
      </div>
      <Calendar 
      localizer={localizer} events={allEvents} 
      startAccessor="start" endAccessor="end"
      style={{ height: 500, margin: "50px" }} 
        components={{ event: CustomEvent}}
      />
    </div>
  );
}




export default App;
